import styles from './SobreMim.module.css';
import PostModelo from 'components/PostModelo';
import fotoCapa from 'assets/sobre_mim_capa.png';
import fotoSobreMim from 'assets/sobre_mim_foto.png';

export default function SobreMim() {
  return (
    <PostModelo
      fotoCapa={fotoCapa}
      titulo="Sobre mim"
    >
      <h3 className={styles.subtitulo}>
        Olá, eu sou o Matheus!
      </h3>
      <img 
        src={fotoSobreMim}
        alt="Foto do Matheus Rocha"
        className={styles.fotoSobreMim}
      />

      <p className={styles.paragrafo}>
        Oi, tudo bem? Eu sou estudante de Front-end na Alura e estou feliz em te ver por aqui.
      </p>

      <p className={styles.paragrafo}>
        Minha história com programação começou na ETEC Profa. Dra. Doroti Quiomi Kanashiro Toyohara, quando fiz o ensino médio integrado ao curso de Eletrônica. Eu aprendi um pouco de lógica de programação e o básico da linguagem utilizada no arduíno, C++ no caso, mas sem aprofundar muito. Eu gostava muito de estudar a parte do hardware, não gostava muito da parte do software para ser sincero, achava que programar n, mas não imaginava que futuramente seria uma das coisas que eu mais gostaria de fazer.
      </p>
    </PostModelo>
  )
}
